import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  makeStyles,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Grid,
} from '@material-ui/core';
import axios from 'axios';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(4),
    padding: theme.spacing(4),
  },
  formControl: {
    width: '100%',
    marginTop: theme.spacing(2),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
  resultPaper: {
    marginTop: theme.spacing(2),
    padding: theme.spacing(2),
    backgroundColor: '#f5f5f5',
  },
}));

function TransferFunds() {
  const classes = useStyles();
  const [banks, setBanks] = useState([]);
  const [formData, setFormData] = useState({
    fromBank: '',
    toBank: '',
  });
  const [routes, setRoutes] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchBanks = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/banks');
        setBanks(response.data);
      } catch (error) {
        setError('Failed to fetch banks');
      }
    };
    fetchBanks();
  }, []);

  const findRoutes = async () => {
    try {
      const [fastestResponse, cheapestResponse] = await Promise.all([
        axios.post('http://localhost:5000/api/banks/fastestroute', formData),
        axios.post('http://localhost:5000/api/banks/cheapestroute', formData)
      ]);

      setRoutes({
        fastest: fastestResponse.data,
        cheapest: cheapestResponse.data
      });
      setError('');
    } catch (error) {
      setError(error.response?.data?.message || 'An error occurred');
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    findRoutes();
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <Container maxWidth="md">
      <Paper className={classes.paper}>
        <Typography component="h1" variant="h5" gutterBottom>
          Find Optimal Transfer Routes
        </Typography>
        {error && (
          <Typography color="error" variant="body2" gutterBottom>
            {error}
          </Typography>
        )}
        <form onSubmit={handleSubmit}>
          <Grid container spacing={3}>
            <Grid item xs={12} sm={6}>
              <FormControl variant="outlined" className={classes.formControl}>
                <InputLabel>Source Bank (BIC)</InputLabel>
                <Select
                  name="fromBank"
                  value={formData.fromBank}
                  onChange={handleChange}
                  label="Source Bank (BIC)"
                  required
                >
                  {banks.map((bank) => (
                    <MenuItem key={bank.bic} value={bank.bic}>
                      {bank.bic}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12} sm={6}>
              <FormControl variant="outlined" className={classes.formControl}>
                <InputLabel>Destination Bank (BIC)</InputLabel>
                <Select
                  name="toBank"
                  value={formData.toBank}
                  onChange={handleChange}
                  label="Destination Bank (BIC)"
                  required
                >
                  {banks.map((bank) => (
                    <MenuItem key={bank.bic} value={bank.bic}>
                      {bank.bic}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
          </Grid>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >
            Find Routes
          </Button>
        </form>

        {routes && (
          <div>
            <Paper className={classes.resultPaper}>
              <Typography variant="h6" gutterBottom>
                Fastest Route
              </Typography>
              <Typography>
                Path: {routes.fastest.route}
              </Typography>
              <Typography>Time: {routes.fastest.time} minutes</Typography>
            </Paper>
            <Paper className={classes.resultPaper}>
              <Typography variant="h6" gutterBottom>
                Cheapest Route
              </Typography>
              <Typography>
                Path: {routes.cheapest.route}
              </Typography>
              <Typography>Cost: ${routes.cheapest.cost}</Typography>
            </Paper>
          </div>
        )}
      </Paper>
    </Container>
  );
}

export default TransferFunds;
